<?php
if ($_SERVER['REQUEST_METHOD'] === 'POST') {
    $file = 'data.json';
    $records = file_exists($file) ? json_decode(file_get_contents($file), true) : [];

    $newRecord = [
        'isim_soyisim' => $_POST['isim_soyisim'] ?? 'Belirtilmedi',
        'yas_araligi' => $_POST['yas_araligi'] ?? 'Belirtilmedi',
        'iliskidurumu' => $_POST['iliskidurumu'] ?? 'Belirtilmedi',
        'partner_sorunu' => $_POST['partner_sorunu'] ?? 'Belirtilmedi',
        'stres_seviyesi' => $_POST['stres_seviyesi'] ?? 'Belirtilmedi',
        'sorun_suresi' => $_POST['sorun_suresi'] ?? 'Belirtilmedi',
        'sigara' => $_POST['sigara'] ?? 'Belirtilmedi',
        'alkol' => $_POST['alkol'] ?? 'Belirtilmedi',
        'tarih' => date('Y-m-d H:i:s'),
    ];

    $records[] = $newRecord;
    file_put_contents($file, json_encode($records, JSON_PRETTY_PRINT | JSON_UNESCAPED_UNICODE));

    header('Location: success.php');
    exit;
}
